// SPDX-License-Identifier: MIT

pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";
import "./rxgToken.sol";

//------------------------------------------------------------------------------
// poll contract
//------------------------------------------------------------------------------
/** 
 * @title DaoBallot
 * @dev terranart.eth
 * @dev Implements voting process along with voter participation payouts
 */
contract DaoBallot{
// variables
    // contract recharge address
    Recharge public dc;
    bytes32[] public proposalIds;
    uint256 public timer;
    uint256 public mins;
    struct Voter {
        uint weight; // weight is accumulated by payment
        bool voted;  // if true, that person already voted
        uint vote;   // index of the voted proposal
    }

    struct Proposal {
        uint256 proposalId;   // real world proposal id
        uint256 voteCount; // number of accumulated votes
    }

    address public admin;
// modifiers
    modifier onlyAdmin() {
        require(msg.sender == admin,"Admin only");
        _;
    }

    modifier timerFinished() {
        require(wait(mins), "Wait for vote timer to expire");
        _;
    }
// mapping
    mapping(address => Voter) public voters;
    Proposal[] public proposals;
// constructor
    /** 
     * @dev Create a new ballot to choose one of 'proposalIds'.
     * @param _coin the token address to be paid in, _minutes how many minutes the poll should last, _proposalIds the names of the proposals
     * 
     */
    constructor(Recharge _coin, uint256 _minutes, uint256 _numberProposals){
        dc = _coin;
        mins = _minutes;
        admin = msg.sender;
        voters[admin].weight = 1;
        // setup proposals
        for (uint i = 0; i < _numberProposals; i++) {
            proposals.push(Proposal({proposalId: i, voteCount: 0}));
        }
    }

// functions
    /** 
     * @dev give a wait timer.
     * @param _minutes number of minutes to wait
     */
    function wait(uint256 _minutes) internal view returns(bool) {
        uint256 stop = _minutes * (1 minutes);
        require(block.timestamp - timer > stop, "Wait for vote timer to expire");
        return true;
    }

    /** 
     * @dev Give 'voter' the right to vote on this ballot. May only be called by 'admin'.
     * @param voter address of voter
     * todo: be able to pass in a array of addresses
     */
    function addVoter(address voter) external onlyAdmin {
        timer = block.timestamp; //ensures last person invited starts the timer
        require(
            !voters[voter].voted,
            "The voter already voted."
        );
        voters[voter].weight = 1;
    }



    /**
     * @dev Give your vote to proposal 'proposals[proposal].id'.
     * 
     * @param proposal index of proposal in the proposals array
     */
    function vote(uint proposal) external {
        Voter storage sender = voters[msg.sender];
        require(sender.weight != 0, "Has no weight to vote");
        require(!sender.voted, "Already voted.");
        sender.voted = true;
        sender.vote = proposal;
        // If 'proposal' is out of the range of the array,
        // this will throw automatically and revert all
        proposals[proposal].voteCount += sender.weight;
        require(dc.payPoll(msg.sender), "Token didn't pay"); //pay the voter in token
    }

    /** 
     * @dev Computes the winning proposal taking all previous votes into account.
     * @return winningProposal_ index of winning proposal in the proposals array
     */
    function winningProposal() internal view
            returns (uint winningProposal_)
    {
        uint winningVoteCount = 0;
        for (uint p = 0; p < proposals.length; p++) {
            if (proposals[p].voteCount > winningVoteCount) {
                winningVoteCount = proposals[p].voteCount;
                winningProposal_ = p;
            }
        }
    }

    /** 
     * @dev Calls winningProposal() function to get the index of the winner after the voting period.
     * @return winnerName_ the name of the winner
     */ 
    function winnerName() external view timerFinished
            returns (uint256 winnerName_)
    {
        winnerName_ = proposals[winningProposal()].proposalId;
    }

} // end of ballot contract

